import React, { Component, Fragment } from 'react'
import {Route, NavLink, Redirect} from 'react-router-dom'
import Chart from './Ticker/Chart'
import Summary from './Ticker/Summary'
import Statistic from './Ticker/Statistic'
import '../styles/style.css';
import '../styles/dash.css';

export default class Lookup extends Component {
    state = {
        lookupTicker: null
    }
    pickHandle = (symbol) => {
        this.setState({
            lookupTicker: symbol
        })
    }

    render() {
        let secondRouteList
        
        secondRouteList = [
            <Route exact path="/dashboard/lookup" render={(props)=><Redirect to="/dashboard/lookup/summary"/>}/>,

            <Route exact path="/dashboard/lookup/summary/:symbol?" render={(props)=>
                <Summary {...props} />}/>,
            <Route exact path="/dashboard/lookup/chart/:symbol?" render={(props)=>
                <Chart {...props} />}/>,
            <Route exact path="/dashboard/lookup/statistic/:symbol?" render={(props)=>
                <Statistic {...props} />}/>,
        ]
        
        let linkToSummary = this.props.lookupTicker?`/dashboard/lookup/summary/${this.props.lookupTicker}`:`/dashboard/lookup/summary`
        let linkToChart = this.props.lookupTicker?`/dashboard/lookup/chart/${this.props.lookupTicker}`:`/dashboard/lookup/chart`
        let linkToStatistic = this.props.lookupTicker?`/dashboard/lookup/statistic/${this.props.lookupTicker}`:`/dashboard/lookup/statistic`
        return (
            <Fragment>
                <div className="navheader">
                    <div className={"tag"}>
                        <NavLink
                            exact to={linkToSummary}
                            style={{textDecoration:"none", color:"rgb(28, 104, 243)"}}
                            >Summary
                        </NavLink>
                    </div>
                    <div className={"tag"}>
                        <NavLink
                            exact to={linkToChart}
                            style={{textDecoration:"none", color:"rgb(28, 104, 243)"}}
                            >Chart
                        </NavLink>
                    </div>
                    <div className={"tag"}>
                        <NavLink
                            exact to={linkToStatistic}
                            style={{textDecoration:"none", color:"rgb(28, 104, 243)"}}
                            >Statistic
                        </NavLink>
                    </div>
                </div>
                <div className={"lookup-field"}>
                    {secondRouteList}
                </div>
            </Fragment>
        )
    }
}
